import React,{Component} from 'react';
import { ForceGraph2D} from 'react-force-graph';
class highlightGraph extends Component{
    render(){
        return(
            <ForceGraph2D graphData={this.props.gData} nodeRelSize={10} width={700} height={600}/>
        )
    }
}
export default highlightGraph;
